import { combineReducers } from 'redux';
import marcasReducer from "./marcasReducer";
import productosReducer from "./productosReducer";
import carritoReducer from './carritoReducer';
import categoriasReducer from './categoriasReducer';
import subcategoriaReducer from './subcategoriasReducer';
export default combineReducers({
  marcasReducer: marcasReducer,
  productosReducer: productosReducer,
  carritoReducer: carritoReducer,
  categoriasReducer: categoriasReducer,
  subcategoriaReducer: subcategoriaReducer
});
